const weeksPerPhase={1:6,2:4,3:3};function checkWorkoutLoader(){if(window.workoutLoader){console.log("WorkoutLoader found, loading all phases and weeks..."),Object.keys(weeksPerPhase).forEach(e=>{const o=parseInt(e);for(let e=1;e<=weeksPerPhase[o];e++)try{console.log(`Pre-loading Phase ${o}, Week ${e} data...`),"function"==typeof window.workoutLoader.loadData?window.workoutLoader.loadData(o,e):"function"==typeof window.loadWorkoutData?window.loadWorkoutData(o,e):console.warn(`No method available to load workout data for Phase ${o}, Week ${e}`)}catch(r){console.error(`Error loading Phase ${o}, Week ${e}:`,r)}});return console.log("All phases and weeks pre-loaded"),!0}return!1}document.addEventListener("DOMContentLoaded",function(){console.log("DOM loaded, checking for workoutLoader..."),setTimeout(()=>{checkWorkoutLoader()||(console.log("WorkoutLoader not available yet, will retry..."),setTimeout(()=>{checkWorkoutLoader()||(console.log("WorkoutLoader still not available, will retry once more..."),setTimeout(()=>{checkWorkoutLoader()||console.error("WorkoutLoader not available after multiple attempts")},2e3))},1500))},1e3)});